import React from 'react'
import { NavLink } from 'react-router-dom';
import Logo from "../image/logo.png"

export default function Navbar() {
    return(
        <>
        <section>
            <NavLink><img src={Logo} alt="" /></NavLink>
            <div></div>
        </section>
        </>
    );
};
